//set main namespace
goog.provide('cs.binary_numbers');


//get requirements
goog.require('lime.Director');
goog.require('lime.Scene');
goog.require('lime.Layer');
goog.require('lime.Circle');
goog.require('lime.Label');
goog.require('lime.animation.Spawn');
goog.require('lime.animation.FadeTo');
goog.require('lime.animation.ScaleTo');
goog.require('lime.animation.MoveTo');

goog.require('game.FlipCard');
goog.require('game.Audio');

cs.binary_numbers.Width = 1024;
cs.binary_numbers.Height = 768;

cs.binary_numbers.pokeball = 'data:image/png;base64,';

cs.binary_numbers.snd_click1_file= 'assets/snd_click1.mp3';
cs.binary_numbers.snd_click1_mp3 = '';
cs.binary_numbers.snd_click1_ogg = '';

cs.binary_numbers.snd_click2_file= 'assets/snd_click2.mp3';
cs.binary_numbers.snd_click2_mp3 = '';
cs.binary_numbers.snd_click2_ogg = '';

cs.binary_numbers.isSoundInit = false;

cs.binary_numbers.cardBackgroundColor = "#EFF8FB";

isChecking = false;
cardSelected = '';



cs.binary_numbers.pokeballWidth = 35;

cs.binary_numbers.boxWidth = 190;
cs.binary_numbers.boxHeight = 290;
cs.binary_numbers.boxTitleHeight = 40;
cs.binary_numbers.boxTextFontSize = 30;



//cs.binary_numbers.cardBorder = 2;
//cs.binary_numbers.cardBorderColor = '#808080';

cs.binary_numbers.cardBorder = 3;				//card 被選時的邊框粗細
cs.binary_numbers.cardBorderColor = '#5882FA';	//card 被選時的邊框顏色

cs.binary_numbers.cardBack = "assets/smile.png";	//card 背面的文字或圖案
cs.binary_numbers.cardBackColor = '#6F4E37';		//card 背面文字的背景顏色

// entrypoint
cs.binary_numbers.start = function(){

	var director = new lime.Director(document.body,cs.binary_numbers.Width ,cs.binary_numbers.Height),
	    scene = new lime.Scene();


	director.makeMobileWebAppCapable();
	director.setDisplayFPS(false);	//關掉左上角的 FPS 資訊

	cardGap = 10;
	cardXstart = (cs.binary_numbers.Width-(cs.binary_numbers.boxWidth*4+cardGap*4))/2;
	cardYstart = cs.binary_numbers.Height/2;
	
	var cards = new Array();
	for(var c=4; c>=0; c--) {
		var back = new lime.Sprite().setSize(cs.binary_numbers.boxWidth,cs.binary_numbers.boxHeight)
									.setFill(cs.binary_numbers.cardBackgroundColor)
									.setStroke(cs.binary_numbers.cardBorder, cs.binary_numbers.cardBorderColor);

		var front = new lime.Sprite().setSize(cs.binary_numbers.boxWidth,cs.binary_numbers.boxHeight)
									.setStroke(cs.binary_numbers.cardBorder, cs.binary_numbers.cardBorderColor);
		
		front.balls = new Array();
		total = Math.pow(2,c);
		if(total > 1) {
			row = total >= 4 ? 4 : 2;
		} else {
			row = 1;
		}
		gap = 8;
		xStart = (cs.binary_numbers.pokeballWidth+gap)*(total/row-1)/-2;
		yStart = (cs.binary_numbers.pokeballWidth+gap)*(row-1)/-2;
		for(var b=0; b<total; b++) {
			x = xStart + Math.floor(b/row)*(cs.binary_numbers.pokeballWidth+gap);
			y = yStart + (b%row)*(cs.binary_numbers.pokeballWidth+gap);
			front.balls[b] = new lime.Sprite()
										.setFill(cs.binary_numbers.pokeball)
										.setSize(cs.binary_numbers.pokeballWidth, cs.binary_numbers.pokeballWidth)
										.setPosition(x, y);
			front.appendChild(front.balls[b]);
		}
			
		cards[c] = new game.FlipCard(back, front, function() {
			if( this.isBack() ) {
				cs.binary_numbers.sound_click1.playing_ = false;
				cs.binary_numbers.sound_click1.play();
			} else {
				cs.binary_numbers.sound_click2.playing_ = false;
				cs.binary_numbers.sound_click2.play();			
			}
		}).setPosition(cardXstart+(cs.binary_numbers.boxWidth+cardGap)*(4-c),cardYstart);
		scene.appendChild(cards[c]);
		
	}
	
	cs.binary_numbers.createAudioObject();
	
	// set current scene active
	director.replaceScene(scene);

}

cs.binary_numbers.createAudioObject = function() {
	cs.binary_numbers.isSoundInit = false;
	cs.binary_numbers.sound_click1 = new game.Audio(cs.binary_numbers.snd_click1_file, cs.binary_numbers.snd_click1_mp3, cs.binary_numbers.snd_click1_ogg);
	cs.binary_numbers.sound_click2 = new game.Audio(cs.binary_numbers.snd_click2_file, cs.binary_numbers.snd_click2_mp3, cs.binary_numbers.snd_click2_ogg);
}

cs.binary_numbers.soundInit = function() {
	cs.binary_numbers.isSoundInit = true;
	//if(!cs.binary_numbers.isSoundInit && sound_win.isLoaded()) {
	//如果是 iOS 的, 要先利用按鈕播放一次, 後續才能用程式控制
	if( lime.userAgent.IOS ) {	
		try {
			cs.binary_numbers.sound_click1.playing_ = false;
			cs.binary_numbers.sound_click2.playing_ = false;
		} catch(e) {};
		try {
			cs.binary_numbers.sound_click1.setVolume(0);
		} catch(e) {};
		try {
			cs.binary_numbers.sound_click1.play();
		} catch(e) {};
		try {
			cs.binary_numbers.sound_click2.setVolume(0);
		} catch(e) {};
		try {
			cs.binary_numbers.sound_click2.play();
		} catch(e) {};
		
		//alert('test');
	} else {
		try {
			cs.binary_numbers.sound_click1.setVolume(1);
		} catch(e) {};	
		try {
			cs.binary_numbers.sound_click2.setVolume(1);
		} catch(e) {};
		//cs.binary_numbers.sound_correct.play();
		//cs.binary_numbers.sound_wrong.play();
	}

};

//this is required for outside access after code is compiled in ADVANCED_COMPILATIONS mode
goog.exportSymbol('cs.binary_numbers.start', cs.binary_numbers.start);
